import React, { useEffect, useState } from "react";
import "../Css/NavPanel.css";
import { Link } from "react-router-dom";
import AddCircleOutlinedIcon from "@mui/icons-material/AddCircleOutlined";
import GradientOutlinedIcon from "@mui/icons-material/GradientOutlined";
import RuleIcon from "@mui/icons-material/Rule";
import AssignmentTurnedInIcon from "@mui/icons-material/AssignmentTurnedIn";
import SummarizeIcon from "@mui/icons-material/Summarize";
import PriorityHighIcon from "@mui/icons-material/PriorityHigh";

const NavPanel = () => {
  return (
    <div className="nav-section">
      <div>
        <div>User Name</div>
      </div>
      <Link to="/add_gsm" className="nav-link">
        <AddCircleOutlinedIcon sx={{ color: "#95775D", fontSize: 20 }} />
        <div className="nav-link-text">Add GSM</div>
      </Link>
      <Link to="/add_shade" className="nav-link">
        <GradientOutlinedIcon sx={{ color: "#95775D", fontSize: 20 }} />
        <div className="nav-link-text">Add Shade</div>
      </Link>
      <Link to="/add_high_defects" className="nav-link">
        <PriorityHighIcon sx={{ color: "#95775D", fontSize: 20 }} />
        <div className="nav-link-text">No of High Defects</div>
      </Link>
      <Link to="/pass_fail_status" className="nav-link">
        <RuleIcon sx={{ color: "#95775D", fontSize: 20 }} />
        <div className="nav-link-text">Pass Fail Status</div>
      </Link>
      <Link to="/batch_status" className="nav-link">
        <AssignmentTurnedInIcon sx={{ color: "#95775D", fontSize: 20 }} />
        <div className="nav-link-text">Batch Status</div>
      </Link>
      <Link to="/reports" className="nav-link">
        <SummarizeIcon sx={{ color: "#95775D", fontSize: 20 }} />
        <div className="nav-link-text">Report</div>
      </Link>
    </div>
  );
};

export default NavPanel;
